    let newVal = current + delta;
    
    // tanh
    // : 0.50.5
    let bounded = 0.5 + 0.5 * tanh(2.0 * (newVal - 0.5));

    textureStore(outputTex, coords, vec4<f32>(bounded, abs(variation) * 10.0, 0.0, 1.0));
